import React from "react";
import MainHOC from "../component/main.hoc";

const SearchJud = () => {
  return (
    <MainHOC>
      <div className="hero-body is-fullheight">
        <div className="container">
          <div className="columns is-vcentered">
            <div className="column is-12 is-offset-1 landing-caption">
            <label class="label is-large">ค้นหาข้อมูลเงินเดือน ตั้งแต่มกราคม 2563</label>
            
            </div>
          </div>
          <div className="is-divider-vertical" data-content="OR"></div>
        </div>
      </div>
    </MainHOC>
  );
};
export default SearchJud;
